  "qa1_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uC6F9\uC0AC\uC774\uD2B8\uB294 \uBB34\uB8CC\uC778\uAC00\uC694?" } },
  "qa1_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uC644\uC804\uD788 \uBB34\uB8CC\uB294 \uC544\uB2D9\uB2C8\uB2E4. \uC7A5\uAE30\uC801\uC778 \uBC1C\uC804\uC744 \uC704\uD574 \uD5A5\uD6C4 \uC694\uAE08 \uBD80\uACFC\uB294 \uBD88\uAC00\uD53C\uD558\uC9C0\uB9CC \uC0AC\uC6A9\uC744 \uC704\uD574 \uD544\uC218 \uACB0\uC81C\uB294 \uC544\uB2D9\uB2C8\uB2E4. \uBB34\uB8CC\uC640 \uC720\uB8CC \uC0AC\uC774\uC758 \uADE0\uD615\uC744 \uCC3E\uC73C\uB824 \uD569\uB2C8\uB2E4." } },
  "qa1_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uD504\uB85C\uC81D\uD2B8\uB294 \uC624\uD508\uC18C\uC2A4\uC774\uBA70 \uC9C1\uC811 \uBC30\uD3EC\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4." } },
  "qa2_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uC785\uB825\uD560 \uC218 \uC5C6\uACE0 \uD0A4\uBCF4\uB4DC\uAC00 \uBC18\uC751\uD558\uC9C0 \uC54A\uB098\uC694?" } },
  "qa3_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uB370\uC774\uD130\uB294 \uC5B4\uB514\uC5D0 \uC788\uB098\uC694? \uC5EC\uB7EC \uCEF4\uD4E8\uD130/\uAE30\uAE30\uC5D0\uC11C \uC5B4\uB5BB\uAC8C \uC0AC\uC6A9\uD558\uB098\uC694?" } },
  "qa3_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uBAA8\uB4E0 \uC0AC\uC6A9\uC790 \uB370\uC774\uD130\uB294 \uB85C\uCEEC \uBE0C\uB77C\uC6B0\uC800\uC5D0 \uC800\uC7A5\uB429\uB2C8\uB2E4. \uB2E4\uB978 \uAE30\uAE30\uB098 \uBE0C\uB77C\uC6B0\uC800\uC5D0\uC11C Type Words\uB97C \uC0AC\uC6A9\uD558\uB824\uBA74 \uC218\uB3D9\uC73C\uB85C \uB370\uC774\uD130\uB97C \uB0B4\uBCF4\uB0B4\uACE0 \uAC00\uC838\uC640\uC57C \uD569\uB2C8\uB2E4." } },
  "qa3_q2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uC124\uC815 -> \uB370\uC774\uD130 \uC124\uC815 -> \uC6D0\uB798 \uCEF4\uD4E8\uD130\uC5D0\uC11C \uB370\uC774\uD130 \uB0B4\uBCF4\uB0B4\uAE30 -> \uC18C\uC15C \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB85C \uC0C8 \uCEF4\uD4E8\uD130\uC5D0 \uC804\uC1A1 -> \uC0C8 \uCEF4\uD4E8\uD130\uC5D0\uC11C \uAC00\uC838\uC624\uAE30" } },
  "qa3_q3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uACC4\uC815 \uC2DC\uC2A4\uD15C \uAC1C\uBC1C \uC911\uC785\uB2C8\uB2E4." } },
  "qa4_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uC6F9\uC0AC\uC774\uD2B8\uAC00 \uC790\uB3D9\uC73C\uB85C \uACC4\uD68D\uD558\uB294 \uB2E8\uC5B4 \uC218\uAC00 \uB108\uBB34 \uB9CE\uC2B5\uB2C8\uB2E4. \uC5B4\uB5BB\uAC8C \uC218\uC815\uD558\uB098\uC694?" } },
  "qa4_q1": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uAE30\uBCF8 \uBCF5\uC2B5 \uB2E8\uC5B4\uC640 \uC0C8 \uB2E8\uC5B4\uC758 \uBE44\uC728\uC740 1:4\uC785\uB2C8\uB2E4. \uC0C8 \uB2E8\uC5B4\uAC00 40\uAC1C\uBA74 \uC9C0\uB09C \uC138\uC158\uC5D0\uC11C 40\uAC1C, \uC774\uC804 \uC138\uC158\uC5D0\uC11C 120\uAC1C\uB97C \uBCF5\uC2B5\uD569\uB2C8\uB2E4." } },
