  "qa5_a": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uD559\uC2B5 \uD55C \uBC88\uC744 \uC644\uB8CC\uD558\uB294 \uB370 \uB108\uBB34 \uC624\uB798 \uAC78\uB9BD\uB2C8\uB2E4. \uACFC\uC815\uC774 \uB108\uBB34 \uAE38\uC9C0 \uC54A\uB098\uC694?" } },
